import React from "react";
function Projects(props) {
    return (
        <div>
            <section className="bg-gray-900 text-gray-100" id="projects">
                <div>
                    <h2 className="text-3xl text-gray-100">Project</h2>
                </div>
            </section>
        </div>
    );
}
export default Projects;
